import img from '../images/image1.jpeg';

import CardComponent from "./CardComponent";

export default function TeamComponent() {

    const nic = <CardComponent name="Nazlı" lastname="İkizler Cinbiş" img={img} job="Supervisor"/>;
    const eke = <CardComponent name="Erdem Korhan" lastname="Erdem" img={img} job="Software Developer"/>;
    const ahg = <CardComponent name="Ahmet Hidayet" lastname="Gürbüz" img={img} job="Software Developer"/>;
    const hcy = <CardComponent name="Hüseyin Can" lastname="Yılmaz" img={img} job="Software Developer"/>;

    return (
        <div className="team-component">
            <div className="team-inst">{nic}</div>
            <div className="team-studs">
                <div className="team-card">{eke}</div>
                <div className="team-card">{ahg}</div>
                <div className="team-card">{hcy}</div>
            </div>
        </div>
    );
}
